import React from "react";
import axios from "axios";

function Tables() {
    const baseUrl = "http://localhost:8080";

    const [post, setPost] = React.useState(null);

    React.useEffect(() => {
        axios.get(baseUrl + "/type").then((response) => {
            setPost(response.data);
        });
    }, []);
    return (
        <>
            <table class="table">
                <thead>
                    <tr>
                        <th scope="col">#</th>
                        <th scope="col">Name</th>
                        <th scope="col">Addition Date</th>
                        <th scope="col">Peremption Date</th>
                        <th scope="col">Unit Price</th>
                        <th scope="col">Pieces Number</th>
                        <th scope="col">Unit Quantity</th>
                        <th scope="col">Product'</th>
                    </tr>
                    {/*
                {
		"id":1,
		"name":"type1",
		"addedDate":"2022-09-14",
		"peremptionDate":"2023-09-11",
		"unitPrice":100,
		"piecesNumber":20,
		"totalPrice":2000,
		"unit":"l",
		"totalQuantity":30,
		"unitQuantity":1.5,
		"product":{
			"id":2,
			"productName":"product1",
			"group":{
				"id":1,
				"groupName":"group1"
			}
		}
	}
                 */}
                </thead>
                <tbody>
                    <tr>
                        <th scope="row">{post[0].id}</th>
                        <td>Mark</td>
                        <td>Otto</td>
                        <td>@mdo</td>
                    </tr>
                    <tr>
                        <th scope="row">2</th>
                        <td>Jacob</td>
                        <td>Thornton</td>
                        <td>@fat</td>
                    </tr>
                    <tr>
                        <th scope="row">3</th>
                        <td colspan="2">Larry the Bird</td>
                        <td>@twitter</td>
                    </tr>
                </tbody>
            </table>
            <p>{JSON.stringify(post)}</p>
        </>

    );
}
export default Tables;
